import React from "react";
import axios from "axios";
import { useState, useEffect } from "react";
// import { Enfamils } from "./enfamils";

const Products = () => {
  const [locator, setLocator] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");

  const getLocator = () => {
    axios.get("http://localhost:8000/api/products").then((response) => {
      setLocator(response.data);
    });
  };
  useEffect(() => {
    getLocator();
  }, []);

  return (
    <div className="flex content-center flex-wrap  h-10">
      <input
        type="text"
        placeholder="Search..."
        className="p-10px text-lg box-border content-center h-10 w-50 p-4 border-2 border-gray-400 bg-gray-200"
        onChange={(event) => {
          setSearchTerm(event.target.value);
        }}
      />

      <ul className="p-0 list-none text-blue-600  ">
        {locator
          .filter((locator) => {
            if (searchTerm == "") {
              return locator;
            } else if (
              locator.name.toLowerCase().includes(searchTerm.toLowerCase())
            ) {
            }
          })
          .map((locator) => (
            <li key={locator.id} className="mb:20px text-sm ">
              {locator.name}
            </li>
          ))}
      </ul>
    </div>
  );
};

export default Products;
